  <Row className="justify-content-md-center">
  <Col>centred image and intro text goes here</Col>
  </Row>

    <Row className="justify-content-md-center">
    <Col>
      <Accordion>
        <Card>
          <Card.Header>
            <Accordion.Toggle as={Button} variant="link" eventKey="0">
              Story Time!
            </Accordion.Toggle>
          </Card.Header>
          <Accordion.Collapse eventKey="0">
            <Card.Body>Put in story here of ether it die here </Card.Body>
          </Accordion.Collapse>
        </Card>
        </Accordion>
      </Col>

      </Row>

  </Container>

  );

const App = () => (
    <>
      <EtIDNav />

      <EtIDIntro />
   </>
    );





export default App;
